import React, { Component } from "react";
import {TopicWrapper, TopicItem} from "../style"

class Topic extends Component {
  render() {
      return (
        <TopicWrapper>
          <TopicItem>
            <img
              className="topic-pic"
              src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fimg.lovepik.com%2Fphoto%2F40100%2F6864.jpg_wh860.jpg&imgrefurl=https%3A%2F%2Fzh.lovepik.com%2Fimage-401006864%2Fflower-and-bird.html&tbnid=raFPzCniw3wJ8M&vet=12ahUKEwjrg96L3YvsAhVK9pQKHRWqBEMQMygEegUIARDcAQ..i&docid=bS-6QhLeVkCS8M&w=860&h=608&q=%E8%8A%B1%E9%B3%A5&ved=2ahUKEwjrg96L3YvsAhVK9pQKHRWqBEMQMygEegUIARDcAQ"
            ></img>
          </TopicItem>
        </TopicWrapper>
      );
  }
}

export default Topic;
